  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'frontend';
}

<nav class="navbar navbar-expand-sm bg-dark border-bottom border-body" data-bs-theme="dark" >
    <ul class = "navbar-nav">
        <li class = "nav-item">
            <a routerLink="show-all-employees" routerLinkActive="active" class="nav-link" >Employee List</a>
        </li>
        <li class = "nav-item">
            <a routerLink="add-employee" routerLinkActive="active" class="nav-link" >Add Employee</a>
        </li>
    </ul>
</nav>

<div class="container">

